const styles = {

    container: {
        flex: 1,
        backgroundColor: '#F0F0F5',
        paddingVertical: 25,
    },

    title: {
        color: '#322153',
        fontSize: 20,
        fontFamily: 'Ubuntu_700Bold',
        maxWidth: 260,
        marginTop: 64,
        marginLeft: 115
    },
}

export default styles;
